import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./styles.css";
import Header from "./Header";
import NavigationBar from "./NavigationBar";
import Connexion from "./Connexion"; // Assurez-vous d'avoir ce composant
import FilmsPage from "./FilmsPage"; // Assurez-vous d'avoir ce composant
import Series from "./Series"; // Assurez-vous d'avoir ce composant
import Animes from "./Animes"; // Assurez-vous d'avoir ce composant

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/">
            <Header />
            <NavigationBar />
          </Route>
          <Route path="/connexion">
            <Connexion />
          </Route>
          <Route path="/films">
            <FilmsPage />
          </Route>
          <Route path="/series">
            <Series />
          </Route>
          <Route path="/animes">
            <Animes />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
